import{_ as a,c as e,o as r,U as t}from"./chunks/framework.72c98edf.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"front/basic/历史开发报错收集.md","filePath":"front/basic/历史开发报错收集.md"}'),i={name:"front/basic/历史开发报错收集.md"},o=t('<h2 id="easyui-datagrid数据与表头错位" tabindex="-1">EasyUI--DataGrid数据与表头错位 <a class="header-anchor" href="#easyui-datagrid数据与表头错位" aria-label="Permalink to &quot;EasyUI--DataGrid数据与表头错位&quot;">​</a></h2><p><img src="https://s2.loli.net/2023/02/25/uTi3eDfPOhyKcvZ.png" alt="4604AE61-A1D8-4dd0-B4F5-01D2EA57EC79.png"> 页面展示有错位，控制台无报错信息。也没有查询到靠谱的解决方法。</p><h3 id="可能原因" tabindex="-1">可能原因 <a class="header-anchor" href="#可能原因" aria-label="Permalink to &quot;可能原因&quot;">​</a></h3><ol><li>datagrid重新渲染导致的错位<a href="#refer-anchor-1"><sup>1</sup></a></li><li>推测表头或者单元格的class名应该是用字段名拼出来的，如果含有特殊字符可能违反了css的命名规则<a href="#refer-anchor-2"><sup>2</sup></a></li><li>当有多个datagrid同时存在并且有人初始化查询过，就可能导致另外的datagrid查询后不再设置宽度，从而导致列挤在一起，只需将这里的if判断注释掉，改成全部都会设置宽度就不会再出现这种情况<a href="#refer-anchor-3"><sup>3</sup></a></li></ol><h3 id="方法" tabindex="-1">方法 <a class="header-anchor" href="#方法" aria-label="Permalink to &quot;方法&quot;">​</a></h3><h4 id="思路" tabindex="-1">思路 <a class="header-anchor" href="#思路" aria-label="Permalink to &quot;思路&quot;">​</a></h4><p>上述推测和解决方案未能解决笔者遇到的错位问题。死马当作活马医的情况下，笔者咨询了Chat-GPT，答案如下：</p><p>没头没脑的，给笔者一点想法，是否只是表格数据宽度不一致而导致的？</p><h4 id="解决方案" tabindex="-1">解决方案 <a class="header-anchor" href="#解决方案" aria-label="Permalink to &quot;解决方案&quot;">​</a></h4><p><strong>项目中实际设置给定的宽高，将固定值修改为百分比并且，百分比总值超过100，即便是超过1%错位问题也没有了。</strong></p><h2 id="npm-err-cannot-read-properties-of-null-reading-pickalgorithm" tabindex="-1"><code>npm ERR! Cannot read properties of null (reading &#39;pickAlgorithm&#39;)</code> <a class="header-anchor" href="#npm-err-cannot-read-properties-of-null-reading-pickalgorithm" aria-label="Permalink to &quot;`npm ERR! Cannot read properties of null (reading &#39;pickAlgorithm&#39;)`&quot;">​</a></h2><p>运行Vue3 + Vite项目时报错：<code>npm cache clear --force</code></p><h2 id="参考" tabindex="-1">参考 <a class="header-anchor" href="#参考" aria-label="Permalink to &quot;参考&quot;">​</a></h2><div id="refer-anchor-1"></div><ul><li>[1] <a href="https://blog.csdn.net/BtWangZhi/article/details/79463152" target="_blank" rel="noreferrer">datagrid重新渲染导致的错位</a></li></ul><div id="refer-anchor-2"></div><ul><li>[2] <a href="https://www.cnblogs.com/liqipeng/p/4609105.html" target="_blank" rel="noreferrer">easyui使用datagrid时列名包含特殊字符导致表头与数据错位的问题</a></li></ul><div id="refer-anchor-3"></div><ul><li>[3] <a href="https://blog.csdn.net/q394895302/article/details/89631519?utm_medium=distribute.pc_relevant.none-task-blog-2~default~baidujs_baidulandingword~default-1-89631519-blog-79463152.pc_relevant_3mothn_strategy_and_data_recovery&amp;spm=1001.2101.3001.4242.2&amp;utm_relevant_index=4" target="_blank" rel="noreferrer">easyUI版本问题</a></li></ul>',19),l=[o];function n(d,s,c,h,p,_){return r(),e("div",null,l)}const m=a(i,[["render",n]]);export{f as __pageData,m as default};
